function isValid(input, context) {
  var isValid = true;
  var errMsg = "";
  var errCode = 0;
  var coreValidator = context.getValidator("coreValidator");
  var logger = context.getLogger();

  if (coreValidator.matchRegex(/GIR[ ]?0AA|((AB|AL|B|BA|BB|BD|BH|BL|BN|BR|BS|BT|BX|CA|CB|CF|CH|CM|CO|CR|CT|CV|CW|DA|DD|DE|DG|DH|DL|DN|DT|DY|E|EC|EH|EN|EX|FK|FY|G|GL|GY|GU|HA|HD|HG|HP|HR|HS|HU|HX|IG|IM|IP|IV|JE|KA|KT|KW|KY|L|LA|LD|LE|LL|LN|LS|LU|M|ME|MK|ML|N|NE|NG|NN|NP|NR|NW|OL|OX|PA|PE|PH|PL|PO|PR|RG|RH|RM|S|SA|SE|SG|SK|SL|SM|SN|SO|SP|SR|SS|ST|SW|SY|TA|TD|TF|TN|TQ|TR|TS|TW|UB|W|WA|WC|WD|WF|WN|WR|WS|WV|YO|ZE)(\d[\dA-Z]?[ ]?\d[ABD-HJLN-UW-Z]{2}))|BFPO[ ]?\d{1,4}/i, input.regaddress_postcode)) {} else {
    isValid = false;
    errMsg = "" + input.regaddress_postcode + " does not match the valid pattern";
    errCode = 10;
  }

  if (!isValid) {
    var message = "(" + errCode + ") " + errMsg;
    logger.warn("Validation failed with error {}", message);
  }

  return {
    "isValid": isValid,
    "errorCode": errCode,
    "errorMsg": errMsg
  };
}
